const GifsSlideShow = ({ imgs }) => {
  const [image, setImage] = useState()

  return <div></div>
}

function GIFs(props) {
  return (
    <div>
      <img src="/components/gifs/bike.gif"></img>
    </div>
  )
}

export default GIFs
